export function Initialize()
{

}


function Apply()
{
    var packet = [];
    
    packet[0] = 0x11;
    packet[1] = 0xFF;
    packet[2] = 0x03;
    packet[3] = 0x3A;

    device.write(packet, 20);  
}


function SendPacket(zone)
{
    var packet = [];
    packet[0] = 0x11;
    packet[1] = 0xFF;
    packet[2] = 0x0C;
    packet[3] = 0x3A;
    packet[4] = zone
    packet[5] = 0x01;
        var iKeyPosX = vLedPositions[zone-1][0];
        var iKeyPosY = vLedPositions[zone-1][1];
        var col = device.color(iKeyPosX,iKeyPosY);
        packet[6] = col[0];
        packet[7] = col[1];
        packet[8] = col[2];        
    
    packet[9] = 0x02

    device.write(packet, 20);
    device.pause(10);
}


export function Render()
{
    for(let zone = 1; zone < 6; zone++){
        SendPacket(zone);
    }
    device.pause(5)
    Apply()
}


